        Surabaya -  Polisi hingga kini masih menyelidiki siapa penyebar video viral perempuan telanjang di Surabaya. Hasil patroli cyber, keberadaan pengunggah terdeteksi di Jabodetabek. Video diunggah di media sosial Twitter dan akhirnya viral."Pengunggah video sudah teridentifikasi keberadaanya," kata Kanit Resmob Polrestabes Surabaya, Iptu Arief Rizky Wicaksono kepada detikcom, Sabtu (20/6/2020).Baca juga: Soal Dokter Telanjang yang Viral dan Pengunggah Videonya TeridentifikasiArief menjelaskan keberadaan pengunggah video tersebut ada di luar Kota Surabaya. Dari hasil patroli cyber, keberadaannya terdeteksi di Jabodetabek.
